  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponent {

  constructor(private appComponent: AppComponent) { }

  ngOnInit() {
    this.appComponent.hideNavbar = true;
  }
}
